        /// <summary>
        /// Data formatada,  Registra a data em que é feito o insert
        /// </summary>
        private static readonly String dataInsert = DateTime.Now.ToString("yyyy/MM/dd HH:mm:ss.fff");

        //===  METODO PARA REALIZAR INSERTs NO BANCO DE DADOS SQLCe =====================================================================================
        private static void Executa_Query_Insert(string strconnBD01, List<string> PAR_Instrucoes)
        {
            try
            {
                //--------------------------------------------------------------------------------------------------
                //COMANDOS DE INSERT: criar as tabelas e parametros SQL 
                //--------------------------------------------------------------------------------------------------
                //estabelece a conexão na base
                SqlCeConnection CONEXAO = new SqlCeConnection(strconnBD01);
                CONEXAO.Open();//abre a conexao:

                //Criar comando Sql:
                SqlCeCommand ComandoSQL = new SqlCeCommand();
                ComandoSQL.Connection = CONEXAO;

                //Executar instruções conforme lista de parametros criada ao instanciar o objeto                              
                StringBuilder str = new StringBuilder(); //criar objeto para concatenar as partes da string.

                //faz um loop para montar q query
                foreach (string ITEM in PAR_Instrucoes)
                {
                    if (ITEM.StartsWith("INSERT INTO")) //se iniciar com ...
                    {
                        //Mensagem de teste:
                        //MessageBox.Show(ITEM);

                        //Reseta query:
                        str = new StringBuilder();
                        str.Append(ITEM);
                    }
                    else if (ITEM == "FIM" || ITEM == "GO") // se ITEM for igual a FIM!, indica que terminou as instruções
                    {
                        try
                        {
                            //FECHA A CONSTRUÇÃO DA QUERY E EXECUTA-LA:
                            ComandoSQL.CommandText = str.ToString();
                            ComandoSQL.ExecuteNonQuery();//injeta a QUERY

                        }
                        catch (Exception Er)
                        {
                            //fechar o camando e a ligação:
                            ComandoSQL.Dispose();
                            CONEXAO.Close();
                            CONEXAO.Dispose();
                            throw new Exception("Erro de Comando SQL! \n " + Er.Message);
                        }
                    }
                    else //caso nao for nenhuma das opções acima: nem fim 
                    {
                        //se a linha nao começa com "INSERT INTO..."adiciona a string da instrução
                        str.Append(ITEM);
                    }
                }

                //fechar o camando e a ligação:
                ComandoSQL.Dispose();
                CONEXAO.Close();
                CONEXAO.Dispose();

            }
            catch (Exception erro)
            {
                throw new Exception("Erro ao tentar executar insert SqlCe BD01! \n " + erro.Message);
            }
        }

